            </p>
            <div className='center pa4 br3 shadow-5'>
                <input type='text' className="f4 pa2 w-70 center"/>
                <button className="f4 grow w-30 link ph3 dib white bg-light-blue">Detect</button>
            </div>
        </div>
    )
}

export default ImageLinkForm;
